const Resume = () => {

  const onResumeClick = () => {
    window.open(Pdf)
  }

  return(
    <div>
      <h1>my resume</h1>
      <h1>resumee</h1>
        <a onClick={onResumeClick}>Download Pdf</a>
    </div>
  )
}
export default Resume
